Compõe casa do caseiro, poço, fossa, iluminação, telefone, internet, TV a cabo, ponto de ônibus na frente. 

Imóvel de fácil acesso em rua asfaltada em bairro tranquilo, espaço ideal para se divertir em segurança com sua família. 

